// ==UserScript==
// @name         HWM_TavernAlert
// @namespace    Небылица
// @version      1.23
// @description  Уведомление о принятии заявки в таверне
// @author       Небылица
// @include      /^https{0,1}:\/\/((www|qrator)\.heroeswm\.ru|178\.248\.235\.15)\/.+/
// @exclude      /^https{0,1}:\/\/((www|qrator)\.heroeswm\.ru|178\.248\.235\.15)\/(login|war|cgame|frames|chat|chatonline|ch_box|chat_line|ticker|chatpost)\.php.*/
// @grant        GM_setValue
// @grant        GM_getValue
// @grant        GM_notification
// ==/UserScript==

(function(){
    "use strict";

    // Выставляем дефолтные настройки уведомлений
    if (GM_getValue("ifPopupEnabled") === undefined){GM_setValue("ifPopupEnabled", true);} // всплывающее оповещение
    if (GM_getValue("ifSoundEnabled") === undefined){GM_setValue("ifSoundEnabled", false);} // звук
    if (GM_getValue("soundVolume") === undefined){GM_setValue("soundVolume", 1);} // громкость звука


    var icon = document.querySelector("img[src*='cards.gif'][title='Вас вызвали на дуэль!']"); // получаем иконку таверны
    // Если она есть, то показываем всплывающее оповещение/проигрываем звук при наличии соответствующих настроек
    if (icon !== null){
        if (GM_getValue("ifPopupEnabled")){
            // задаём код для изображения в оповещении в зависимости от наличия новогодней шапки
            var HWMLogoSrc =
                (document.querySelector("img[src*='top_ny_rus/left_big2_.jpg']") === null) ?
                "data:image/png;base64," :
                "data:image/png;base64,";

            GM_notification({text: " ", title: "Ваша заявка в таверне принята!", image: HWMLogoSrc, onclick: function(){
                // ставим на паузу звук (при наличии), чтобы не хрипел
                if (sound !== undefined){sound.pause();}
                // перекидываем отправившую оповещение вкладку на страницу таверны (если уже не на ней) и ставим туда фокус
                if (location.pathname.indexOf("tavern.php") === -1){window.open("tavern.php", "_self");}
                window.focus();
            }});
        }

        if (GM_getValue("ifSoundEnabled")){
            // создаём звук, задаём ему громкость и проигрываем
            var sound = new Audio("data:audio/mp3;base64,");
            sound.volume = GM_getValue("soundVolume");
            sound.play();
            //
            // звук с сайта: https://www.soundsnap.com
        }
    }

    // Вывод настроек на странице таверны
    if (location.pathname === "/tavern.php"){
        // задаём код элемента для вставки
        var tavernAlertSettingsTrInnerHTML =
            "<tr>" +
            "<td width='30%'></td>" +

            "<td id='tavernAlertSettingsHeaderTd'>" +

            "<style>" +
            "#tavernAlertSettingsHeaderTd{" +
            "width: 40%;" +
            "text-align: center;" +
            "font-size: 9pt;" +
            "color: #592C08;" +
            "font-family: verdana, geneva, arial cyr;" +
            "}" +

            "#tavernAlertSettingsInnerDiv{" +
            "width: 52%;" +
            "margin: 0% 24% 0% 24%;" +
            "text-align: center;" +
            "}" +

            ".tavernAlertSettingsCheckboxesSpanLeft{" +
            "display: inline-block;" +
            "width: 87%;" +
            "text-align: left;" +
            "}" +

            ".tavernAlertSettingsCheckboxesSpanRight{" +
            "display: inline-block;" +
            "width: 13%;" +
            "text-align: right;" +
            "}" +

            ".tavernAlertSettingsVolumeSpanLeft{" +
            "display: inline-block;" +
            "width: 53%;" +
            "padding-top: 2px;" +
            "text-align: left;" +
            "}" +

            ".tavernAlertSettingsVolumeSpanRight{" +
            "display: inline-block;" +
            "width: 45%;" +
            "padding: 2px 2% 0px 0px;" +
            "text-align: right;" +
            "}" +

            "#tavernAlertSettingsVolumeSelect{" +
            "width: 57px;" +
            "}" +

            "</style>" +


            "<font id='tavernAlertSettingsHeaderTitle' title='Настроить уведомления о принятии карточной заявки'>Показать настройки уведомлений</font>" +

            "<div id='tavernAlertSettingsInnerDiv'>" +

            "<span class='tavernAlertSettingsCheckboxesSpanLeft'>оповещение</span><span class='tavernAlertSettingsCheckboxesSpanRight'><input type='checkbox' id='tavernAlertSettingsPopupCheckbox'></span><br>" +
            "<span class='tavernAlertSettingsCheckboxesSpanLeft'>звук</span><span class='tavernAlertSettingsCheckboxesSpanRight'><input type='checkbox' id='tavernAlertSettingsSoundCheckbox'></span><br>" +
            "<span class='tavernAlertSettingsVolumeSpanLeft'>громкость</span><span class='tavernAlertSettingsVolumeSpanRight'>" +

            "<select id='tavernAlertSettingsVolumeSelect'>" +
            "<option value='1'>100%</option>" +
            "<option value='0.95'>95%</option>" +
            "<option value='0.9'>90%</option>" +
            "<option value='0.85'>85%</option>" +
            "<option value='0.8'>80%</option>" +
            "<option value='0.75'>75%</option>" +
            "<option value='0.7'>70%</option>" +
            "<option value='0.65'>65%</option>" +
            "<option value='0.6'>60%</option>" +
            "<option value='0.55'>55%</option>" +
            "<option value='0.5'>50%</option>" +
            "<option value='0.45'>45%</option>" +
            "<option value='0.4'>40%</option>" +
            "<option value='0.35'>35%</option>" +
            "<option value='0.3'>30%</option>" +
            "<option value='0.25'>25%</option>" +
            "<option value='0.2'>20%</option>" +
            "<option value='0.15'>15%</option>" +
            "<option value='0.1'>10%</option>" +
            "<option value='0.05'>5%</option>" +
            "</select></span>" +

            "</div></td>" +

            "<td width='30%'></td>" +
            "</tr>";

        // вставляем его в страницу
        var tbody = document.querySelector("td[colspan='6']").firstChild.firstChild,
            tbodyInnerHTML = tbody.innerHTML;
        tbody.innerHTML = tbodyInnerHTML.split("</tr><tr>")[0] + "</tr>" + tavernAlertSettingsTrInnerHTML + "<tr>" + tbodyInnerHTML.split("</tr><tr>")[1];

        // задаём переменные для добавленных элементов
        var tavernAlertSettingsHeaderTitle = document.getElementById("tavernAlertSettingsHeaderTitle"),
            tavernAlertSettingsInnerDiv = document.getElementById("tavernAlertSettingsInnerDiv"),
            tavernAlertSettingsPopupCheckbox = document.getElementById("tavernAlertSettingsPopupCheckbox"),
            tavernAlertSettingsSoundCheckbox = document.getElementById("tavernAlertSettingsSoundCheckbox"),
            tavernAlertSettingsVolumeSelect = document.getElementById("tavernAlertSettingsVolumeSelect"),
            tavernAlertSettingsVolumeSelectChildren = tavernAlertSettingsVolumeSelect.childNodes,

            // и для значений настроек из хранилища
            ifPopupEnabled = GM_getValue("ifPopupEnabled"),
            ifSoundEnabled = GM_getValue("ifSoundEnabled"),
            soundVolume = GM_getValue("soundVolume");

        // по умолчанию скрываем внутренний блок
        tavernAlertSettingsInnerDiv.style.display = "none";

        // выставляем галочки в checkbox'ы для активных способов уведомления
        if (ifPopupEnabled){
            tavernAlertSettingsPopupCheckbox.checked = true;
        }

        if (ifSoundEnabled){
            tavernAlertSettingsSoundCheckbox.checked = true;
        } else{ // и делаем неактивным выпадающий список для громкости, если звук отключён
            tavernAlertSettingsVolumeSelect.disabled = true;
        }

        // прогоняем цикл по элементам select'а, показываем по умолчанию вариант, соответствующий сохранённой настройке
        var i,
            maxI = tavernAlertSettingsVolumeSelect.length;
        for (i=0;i<maxI;i++){
            if (tavernAlertSettingsVolumeSelectChildren[i].value === soundVolume.toString()){
                tavernAlertSettingsVolumeSelectChildren[i].selected = true;
            }
        }

        // показываем/убираем внутренний блок по клику на заголовок
        tavernAlertSettingsHeaderTitle.onclick = function(){
            // если скрыто, то показываем; если открыто, то скрываем; ставим соответствующий текст заголовку
            if (tavernAlertSettingsInnerDiv.style.display === "none"){
                tavernAlertSettingsInnerDiv.style.display = "block";
                tavernAlertSettingsHeaderTitle.innerHTML = "Скрыть настройки уведомлений";
            } else{
                tavernAlertSettingsInnerDiv.style.display = "none";
                tavernAlertSettingsHeaderTitle.innerHTML = "Показать настройки уведомлений";
            }
        };

        // вешаем события по изменению checkbox'ов и select'а громкости
        tavernAlertSettingsPopupCheckbox.onchange = function(){
            GM_setValue("ifPopupEnabled", tavernAlertSettingsPopupCheckbox.checked);
        };

        tavernAlertSettingsSoundCheckbox.onchange = function(){
            GM_setValue("ifSoundEnabled", tavernAlertSettingsSoundCheckbox.checked);
            tavernAlertSettingsVolumeSelect.disabled = !tavernAlertSettingsSoundCheckbox.checked;
        };

        tavernAlertSettingsVolumeSelect.onchange = function(){
            GM_setValue("soundVolume", parseFloat(tavernAlertSettingsVolumeSelect.value));
        };
    }
})();